import React, { Component } from 'react';
import Image from './front1.jpg';
import './particle.css';

class FrontPage extends Component {
  
  render() {
    return (
      <div>
      <div className='color'></div>
    	<div
      style={{backgroundColor:'#cbd1d2',width:900,height:'50vw',transform:'skewX(20deg)',
      position:'relative',top:0,left:-100}}>
  <img style={{width:600,height:'50vw',position:'relative',top:0,left:400}} src={Image} />
      </div>
</div>
    );
  }
}

export default FrontPage;
